import React from 'react'

class ProductRow extends React.Component { 
	render() { 
	var name = this.props.product.name 
	return ( 
		<tr> 
			<td> { name }</td> 
			<td> { this.props.product.price } </td> 
		</tr> 
		); 
	} 
}
export default ProductRow
